import React from 'react';
import {
	Form,
	FormGroup,
	FormControl,
	Button
} from 'react-bootstrap';
import searchForm from './components/SearchForm'


const SearchForm = () => (
	<Form inline>
	  <FormGroup controlId="formInlineEmail">
	    <FormControl type="search" placeholder="enter something..." />
	  </FormGroup>
	  {' '}
	  <Button type="submit">
	    search
	  </Button>
	</Form>
);

export default SearchForm;
